import * as m3o from "@m3o/m3o-node";
export class AnalyticsService {
    constructor(token) {
        this.client = new m3o.Client({ token: token });
    }
    // Delete an event
    delete(request) {
        return this.client.call("analytics", "Delete", request);
    }
    // List all events
    list(request) {
        return this.client.call("analytics", "List", request);
    }
    // Get a single event
    read(request) {
        return this.client.call("analytics", "Read", request);
    }
    // Track an event, it will be created if it doesn't exist
    track(request) {
        return this.client.call("analytics", "Track", request);
    }
}
